-- Views
CREATE VIEW viewDrivers AS (
    SELECT 
        Employee_ID AS "ID",
        CONCAT(Employee_Last_Name, ", ", Employee_First_Name) AS "Last Name, First Name",
        Employee_Phone_Number AS "Phone Number"
    FROM 
        Employee
    WHERE
        1=1
        AND Employee_Job = "Driver"
);

CREATE VIEW viewSalesReps AS (
    SELECT 
        Employee_ID AS "ID",
        CONCAT(Employee_Last_Name, ", ", Employee_First_Name) AS "Last Name, First Name",
        Employee_Phone_Number AS "Phone Number"
    FROM 
        Employee
    WHERE
        1=1
        AND Employee_Job = "Sales"
);

